import React from 'react';
import classes from './MenuItem.module.css';

function MenuItem({ title, children, onClick }) {
  return (
    <div className={classes.menuItem} onClick={() => onClick(title)}>
      <div className={classes.menuTitle}>{title}</div>
      <div className={classes.menuContent}>{children}</div>
    </div>
  );
}

export default MenuItem;
